	 ('2149','Request received email to download my VID card','Request received email to download my VID card','txt','velocity','प्रिय $name, <br> आपका $eventDetails करने का अनुरोध $date को $time पर प्राप्त किया गया है। <br> आपकी घटना आईडी #$eventId है। <br> और विवरण के लिए आधिकारिक वेबसाइट $trackServiceRequestLink पर लॉग इन करें। <br>','10006','Resident Services','vid-card-download-request-received-email-content','hin',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
	 ('2150','Request received email to download my VID card','Request received email to download my VID card','txt','velocity','ಪ್ರಿಯ $name, <br> $date ರಂದು $time ಗೆ $eventDetails ನ ನಿಮ್ಮ ಕೋರಿಕೆ ಸ್ವೀಕರಿಸಲಾಯಿತು. <br> ನಿಮ್ಮ ಈವೆಂಟ್ ಐಡಿ #$eventId ಆಗಿದೆ. <br> ಮತ್ತಷ್ಟು ವಿವರಗಳಿಗಾಗಿ ಆಧಿಕಾರಿಕ ವೆಬ್ಸೈಟ್ $trackServiceRequestLink ಗೆ ಲಾಗಿನ್ ಮಾಡಿ. <br>','10006','Resident Services','vid-card-download-request-received-email-content','kan',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
	 ('2151','Request received email to download my VID card','Request received email to download my VID card','txt','velocity','عزيزي $name، <br> تم استلام طلبك لـ $eventDetails في $date في $time. <br> هوية الحدث الخاصة بك هي #$eventId. <br> قم بتسجيل الدخول إلى الموقع الرسمي $trackServiceRequestLink لمزيد من التفاصيل. <br>','10006','Resident Services','vid-card-download-request-received-email-content','ara',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL);
