	 ('2152','Request received email to download my VID card','Request received email to download my VID card','txt','velocity','பிரிய $name, <br> $eventDetails செய்திக்கு உங்கள் கோரிக்கை $date அன்று $time முடிந்தது. <br> உங்கள் நிகழ்ச்சி ஐடி #$eventId ஆகும். <br> மேலதிக விவரங்களுக்கு அதிகாரிக வலைத்தளத்தில் உள்நுழைக. <br>','10006','Resident Services','vid-card-download-request-received-email-content','tam',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
