	 ('2154','Request received email to download my VID card','Request received email to download my VID card','txt','velocity','Estimado $name, <br> Hemos recibido su solicitud para $eventDetails el $date a las $time. <br> Su identificador de evento es #$eventId. <br> Inicie sesión en el sitio web oficial $trackServiceRequestLink para obtener más detalles. <br>','10006','Resident Services','vid-card-download-request-received-email-content','spa',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
