    -.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>6. ಕೇಂದ್ರ ಸರ್ಕಾರ / ರಾಜ್ಯ ಸರ್ಕಾರ / ಸಂಘ ಸರ್ಕಾರ / ಯೂಟಿ ಸರ್ಕಾರ / ಸಾರ್ವಜನಿಕ ಸೇವಾ ಬ್ಯಾಂಕ್ ನಿರ್ಗಮಿಸಿದ ಫೋಟೊ ಗುರುತಿನ ಪತ್ರ </p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
    -.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>7. ಪೆಂಷನರ್ ಫೋಟೊ ಕಾರ್ಡ್ / ಸ್ವಾತಂತ್ರ ಯುದ್ಧ ಹೋರಾಟಗಾರ ಫೋಟೊ ಕಾರ್ಡ್ </p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
    -.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>8. ಮಧ್ಯಪ್ರದೇಶ / ರಾಜ್ಯ / ಯೂಟಿ ಸರ್ಕಾರಗಳ ಅನುಮೋದಿಸಿದ ಅಶಕ್ತರ ಫೋಟೊ ಐಡಿ ಕಾರ್ಡ್ / ಅಶಕ್ತರ ವೈದ್ಯಕೀಯ ಪರಿಶೋಧನೆ ಪತ್ರ </p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
    -.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>9. ಬ್ಯಾಂಕ್ ಪಾಸ್ ಬುಕ್, ಹೆಸರು ಮತ್ತು ಫೋಟೊ ಗುರುತೊ ಬ್ಯಾಂಕ್ ಅಧಿಕಾರಿ ಮುದ್ರಿತವಾಗಿರಬೇಕು </p>
    <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>10. ವೈದೇಶಿಕ ಪಾಸ್ಪೋರ್ಟ್ ಜೊತೆಗೆ ಮಾನ್ಯ ವಿಸಾ</p>
    </td>
  </tr>
</table>
<p class=MsoNormal><span style=''font-size:16.0pt;line-height:107%;font-family:
  Arial,sans-serif;color:#1D1C1D;background:white''>&nbsp;</span></p>
      <table class=MsoTableGrid border=1 cellspacing=0 cellpadding=0
  style=''border-collapse:collapse;border:none''>
  <tr>
    <td width=623 colspan=2 valign=top style=''width:467.5pt;border:solid windowtext 1.0pt;
    padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
    line-height:normal''><b><span style=''font-size:14.0pt;font-family:Arial,sans-serif;
    color:#1D1C1D;background:aqua''>POA (ವಿಳಾಸದ ಪ್ರಮಾಣ)</span></b></p>
    <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
    line-height:normal''><b><span style=''font-size:14.0pt;font-family:Arial,sans-serif;
    color:#1D1C1D;background:white''>&nbsp;</span></b></p>
    </td>
  </tr>
  <tr style=''height:35.3pt''>
    <td width=217 valign=top style=''width:162.8pt;border:solid windowtext 1.0pt;
    border-top:none;padding:0in 5.4pt 0in 5.4pt;height:35.3pt''>
    <p class=MsoNormal align=center style ''margin-bottom:0in;text-align:center;
    line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
    color:#1D1C1D;background:white''>POA ದಾಖಲೆಗಳ ವಿವರಣೆ:</span></b></p>
    </td>
    <td width=406 valign=top style=''width:304.7pt;border-top:none;border-left:none;
    border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
    padding:0in 5.4pt 0in 5.4pt;height:35.3pt''>
    <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>1. ಅದು ಪೂರ್ಣ ಹೆಸರು ಮತ್ತು ಸಂಪೂರ್ಣ ವಿಳಾಸವನ್ನು ಹೊಂದಿರಬೇಕು</p>
    <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>2. ಮಿನಿಮಂಗೆ 6 ತಿಂಗಳ ಕಾಲ ಮಾನ್ಯತೆಯನ್ನು ಹೊಂದಿರಬೇಕು</p>
    </td>
  </tr>
  <tr>
    <td width=217 valign=top style=''width:162.8pt;border:solid windowtext 1.0pt;
    border-top:none;padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
    line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
    color:#1D1C1D;background:white''>ಅನುಮೋದನೀಯ ದಾಖಲೆ:</span></b></p>
    <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
    line-height:normal''><span style=''font-size:16.0pt;font-family:Arial,sans-serif;
    color:#1D1C1D;background:white''>&nbsp;</span></p>
    </td>
    <td width=406 valign=top style=''width:304.7pt;border-top:none;border-left:none;
    border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
    padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>1. ಪಾಸ್ಪೋರ್ಟ್/ ಜೊತೆಗೆ ಪತಿ/ ಪತ್ನಿ ಪಾಸ್ಪೋರ್ಟ್/ ಮಿನರ್ನ ಸಂದರ್ಭದಲ್ಲಿ ಪೋಷಕರ ಪಾಸ್ಪೋರ್ಟ್</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>2. ಬ್ಯಾಂಕ್ ಸ್ಟೇಟ್ಮೆಂಟ್ (ಬ್ಯಾಂಕ್ ಮುದ್ರಣ ಮತ್ತು ಬ್ಯಾಂಕ್ ಅಧಿಕಾರಿಯ ಸಹಿ)</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>3. ರೇಷನ್ ಕಾರ್ಡ್</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>4. ಮತದಾರ ಗುರುತು/ ಇ-ಮತದಾರ ಗುರುತು</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
    line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>5. ಚಾಲನ ಪರವಾಹಿತ ಪತ್ರ</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>6. PSU/ ಬ್ಯಾಂಕ್/ ರಾಜ್ಯ/ ಕೇಂದ್ರ ಸರ್ಕಾರಗಳಿಂದ ನಿರ್ಗಮಿಸಲಾಗಿರುವ ಸೇವಾ ಫೋಟೊ ಗುರುತಿನ ಪತ್ರ</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>7. ಪೆಂಷನರ್ ಕಾರ್ಡ್/ ಸ್ವಾತಂತ್ರ ಯುದ್ಧ ಹೋರಾಟಗಾರ ಕಾರ್ಡ್</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>8. ಕಿಸಾನ್ ಪಾಸ್ಬುಕ್</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>9. ರಾಜ್ಯ/ ಕೇಂದ್ರ ಸರ್ಕಾರಗಳ/ ಸಾರ್ವಜನಿಕ ಸೇವಾ ಸಂಸ್ಥೆಗಳಿಂದ ಪತ್ರದ ಜೊತೆ ಫೋಟೊದಿದ್ದ ಸಿಜಿಎಚ್ಎಸ್/ ಇಚ್ಎಚ್ಎಸ್/ ಇಎಸಿ/ ಮೆಡಿ-ಕ್ಲೇಮ್ ಕಾರ್ಡ್</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>10. ಅಶಕ್ತತೆ ಐಡಿ ಕಾರ್ಡ್/ ಅಶಕ್ತತೆ ವೈದ್ಯಕೀಯ ಪರಿಶೋಧನೆ ಪತ್ರ (ಪ್ರತಿಷ್ಠಿತ ರಾಜ್ಯ/ಯೂಟಿ ಸರ್ಕಾರಗಳ/ನಿರ್ವಾಚನಾ ಆಯೋಗ/ಕೇಂದ್ರ ಸರ್ಕಾರ)</p>
    <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
    style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    </span>11. ವಿಳಾಸದೊಂದಿದ್ದ ಫೋಟೊ ಐಡಿ ಕಾರ್ಡ್/ ಪತ್ರ (ಕೇಂದ್ರ/ರಾಜ್ಯ ಸರ್ಕಾರಗಳಿಂದ ನಿರ್ಗಮಿಸಿದ್ದರಿಂದ)</p>
    </td>
  </tr>
</table>
<p class=MsoNormal><span style=''font-size:16.0pt;line-height:107%;font-family:
  Arial,sans-serif;color:#1D1C1D;background:white''>&nbsp;</span></p>
<p class=MsoNormal><span style=''font-size:16.0pt;line-height:107%;font-family:
