    <table class=MsoTableGrid border=1 cellspacing=0 cellpadding=0
  style=''border-collapse:collapse;border:none''>
  <tr>
  <td width=623 colspan=2 valign=top style=''width:467.5pt;border:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:14.0pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:aqua''>ಸಂಬಂಧದ ಪ್ರಮಾಣ (POR - Proof of Relationship)</span></b></p>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><span style=''background:white''>&nbsp;</span></p>
  </td>
  </tr>
  <tr>
  <td width=274 valign=top style=''width:205.3pt;border:solid windowtext 1.0pt;
  border-top:none;padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:white''>POR ದಾಖಲೆಗಳ ವಿವರ:</span></b></p>
  </td>
  <td width=350 valign=top style=''width:262.2pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>1. ಪರಿಚಯಕರ್ತೆಯ ಪೂರ್ಣ ಹೆಸರು ಮತ್ತು ಸ್ಪಷ್ಟ ಫೋಟೊನು ಹೊಂದಿರಬೇಕು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>2. ಅರ್ಜಿದಾರನ ಪೂರ್ಣ ಹೆಸರು ಮತ್ತು ಸ್ಪಷ್ಟ ಫೋಟೊನು ಹೊಂದಿರಬೇಕು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>3. ಪರಿಚಯಕರ್ತೆಯ ಮತ್ತು ನಿವಾಸಿಯ ನಡುವಣ ಸಂಬಂಧವನ್ನು ಸ್ಪಷ್ಟವಾಗಿ ಹೇಳಬೇಕು</p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>4. ಎಲ್ಲಾ ಸಿದ್ಧಗೊಂಡ ದಾಖಲೆಗಳು ಕನಿಷ್ಠವಾಗಿ ಮುಂದಿನ 6
  ತಿಂಗಳ ಕಾಲ ಮಾನ್ಯವಾಗಿರಬೇಕು</p>
  </td>
  </tr>
  <tr>
  <td width=274 valign=top style=''width:205.3pt;border:solid windowtext 1.0pt;
  border-top:none;padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:white''>ಅನುಮೋದನೀಯ ದಾಖಲೆ:</span></b></p>
  </td>
  <td width=350 valign=top style=''width:262.2pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>1. ಜೊತೆಗಾದವರ ಪಾಸ್ಪೋರ್ಟ್/ ಪ್ರಜಾಪರಿವಾರದ ಮಕ್ಕಳ ಪಾಸ್ಪೋರ್ಟ್ (ಮಕ್ಕಳ ಸಮಯಸೀಮೆಯಲ್ಲಿ ಮಾತ್ರ)</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>2. ರೇಷನ್ ಕಾರ್ಡು/ ಜನರಾಖುದಾರದ ಕಾರ್ಡು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>3. ಕೇಂದ್ರ/ ರಾಜ್ಯ ಸರ್ಕಾರಗಳು/ ಸಾರ್ವಜನಿಕ ಉದ್ಯಮಗಳು ಇತ್ತೀಚೆಗೆ ವಿತರಿಸಿದ ಫೋಟೊನು ಹೊಂದಿರುವ ಮೆಡಿ-ಕ್ಲೇಮ್ ಕಾರ್ಡು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>4. ಪೆಂಷನ್ ಕಾರ್ಡು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>5. ಹುಟ್ಟು ಪತ್ರವನ್ನು ಹೊಂದಿರುವ ನೋಡಿಸಲಾಗಿದ್ದರು ಪತ್ರ ಜಾರಿ ಹಾಕಲಿನ ಮೂಲಕ, ನಗರದ ನಗರ ಪಾಲಿಕೆ, ಹೊರಗೊಮ್ಮಲು ಸೂಚಿಸಿದ ಸ್ಥಳೀಯ ಸರ್ಕಾರಗಳ ಬಳಕು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>6. ಇತರ ಕೇಂದ್ರ/ ರಾಜ್ಯ ಸರ್ಕಾರಗಳ ವಿತರಣೆಗಳು ದಾಖಲೆ ಕಾರ್ಡು</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>7. ಸರ್ಕಾರದ ವಿವಾಹ ಪತ್ರ</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>8. ಕೇಂದ್ರ/ ರಾಜ್ಯ ಸರ್ಕಾರಗಳ ಜನರಾಖುದಾರದ ಕಾರ್ಡು ಹೀಗೆ ಆಗಿ ಕೇಂದ್ರ/ ರಾಜ್ಯ ಸರ್ಕಾರಗಳ ಫೋಟೊ ಐಡಿ ಕಾರ್ಡು ಇತ್ತೀಚೆಗೆ ಕೇಂದ್ರ/ ರಾಜ್ಯ ಸರ್ಕಾರಗಳು/ ಸ್ವಕೀಯ ಉದ್ಯಮಗಳಿಂದ ಪುಟ್ಟ ಮಕ್ಕಳ ಜನನಕ್ಕೆ ಸರ್ಕಾರ/ ಖಾಸಗಿ ಆಸ್ಪತ್ರೆಗಳಿಂದ ಜಾರಿಹೋದ ಡಿಸ್ಚಾರ್ಜ್ ಕಾರ್ಡು/ ಲಿಪ್ ಮಾಡಲಿದ್ದು (ಮಾತ್ರ 0-5 ವಯಸ್ಸಿನ ಮಕ್ಕಳಿಗೆ) ಜನ್ಮ ಹೊಂದಿದ ಬಾಲನಿವಾಸಿಗಳಿಂದ</p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
