  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>2. كشف حساب بنكي (بختم البنك وتوقيع مسؤول البنك) / كتيب الحساب البريدي / كتيب الحساب في مكتب البريد</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>3. بطاقة التموين</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>4. بطاقة الناخب / بطاقة الناخب الإلكترونية</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>5. رخصة القيادة</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>6. بطاقة الهوية الصورية للخدمة الصادرة عن شركات الدولة / البنوك / الحكومات الولائية والمركزية</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>7. بطاقة المعاشين / بطاقة المحاربين من أجل الحرية</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>8. دفتر كيسان</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>9. بطاقة CGHS / ECHS / ESIC / Medi-Claim مع صورة صادرة عن الحكومات الولائية والمركزية والشركات العامة</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>10. بطاقة الهوية للمعاقين / شهادة طبية للمعاقين صادرة عن الحكومات والإدارات الولائية والمركزية المعنية</p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
