  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>4. بطاقة المعاشين </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>5. شهادة الميلاد صادرة عن مسجل الولادة، البلدية، والهيئات الحكومية المحلية المعلن عنها أخرى </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>6. أي وثيقة أخرى صادرة عن الحكومة المركزية أو الولائية تتعلق بحقوق العائلة </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>7. شهادة الزواج صادرة عن الحكومة </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>8. بطاقة هوية صورية صادرة عن الحكومة المركزية أو الحكومة الولائية مثل بطاقة الجيش وما إلى ذلك </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>9. بطاقة الخروج أو إشعار صادرة عن المستشفيات الحكومية أو الخاصة بمناسبة ولادة طفل (فقط للأطفال الذين تتراوح أعمارهم بين 0 و5 سنوات) </p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>10. تصريح ذاتي من رئيس الأسرة يشهد بالعلاقة مع الساكن في نفس العنوان كرئيس للأسرة<span
