  border-top:none;padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:white''>ஏற்கபடியாக்கக் கொடுக்கக்கூடிய ஆவணம்:</span></b></p>
  </td>
  <td width=406 valign=top style=''width:304.7pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>1. பாஸ்போர்ட் </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>2. பேன் அட்டை/ மின்னுடன் பேன் </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>3. இலவச மற்றும் பிடிஎஸ் புகை அட்டை </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>4. வோட்டர் அட்டை/ மின்னுடன் வோட்டர் அட்டை </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>5. ஓடுவார்ச்சக்காரர் அனுமதி அட்டை </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>6. மத்திய அரசு/ மாநில அரசு/ ஐபி அரசு/ வங்கிகள் வழங்கும் சேவை புகைப்பட அட்டை </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>7. பென்ஷனர் புகை அட்டை/ விடுதநிப்பாள் புகை அட்டை </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>8. பெருவார் ஐடி அட்டை/ சோதித்து மருத்துவ சான்றிதழ் அதிக மாநில/ மாநில/ ஐபி அரசுகள் வழங்கும் </p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
  -.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>9. பங்க் பாஸ் புக் புகைப்படம் பங்க் அதிகாரி குறிக்கோட்டினர் மூலம் மேற்கோள் வழுவீக்கப்பட்டு உள்ளது </p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>10. வெளிநாடு பாஸ்போர்ட் உடைய செய்த வராத விசா </p>
  </td>
  </tr>
</table>
<p class=MsoNormal><span style=''font-size:16.0pt;line-height:107%;font-family:
  Arial,sans-serif;color:#1D1C1D;background:white''>&nbsp;</span></p>
    <table class=MsoTableGrid border=1 cellspacing=0 cellpadding=0
  style=''border-collapse:collapse;border:none''>
  <tr>
  <td width=623 colspan=2 valign=top style=''width:467.5pt;border:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:14.0pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:aqua''>POA (முகவரி சான்றிதழ்)</span></b></p>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:14.0pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:white''>&nbsp;</span></b></p>
  </td>
  </tr>
  <tr style=''height:35.3pt''>
  <td width=217 valign=top style=''width:162.8pt;border:solid windowtext 1.0pt;
  border-top:none;padding:0in 5.4pt 0in 5.4pt;height:35.3pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:white''>POA ஆவண விவரங்கள்:</span></b></p>
  </td>
  <td width=406 valign=top style=''width:304.7pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt;height:35.3pt''>
  <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>1. முழு பெயர் மற்றும் முகவரி இருக்க வேண்டும் </p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>2. அது அடுத்த 6 மாதங்கள் செயலில் செய்த வேண்டும்</p>
  </td>
  </tr>
  <tr>
  <td width=217 valign=top style=''width:162.8pt;border:solid windowtext 1.0pt;
  border-top:none;padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
  color:#1D1C1D;background:white''>ஏற்கபடியாக்கக்கூடிய ஆவணம்:</span></b></p>
  </td>
  <td width=406 valign=top style=''width:304.7pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
  <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>1. பாஸ்போர்ட்/ கணவர்/ பெரும்பாலர் பாஸ்போர்ட் (பிள்.மார். கடிதம்)</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>2. வங்கி அறிக்கை (வங்கி முத்திரை மற்றும் வங்கி அதிகாரியின் ஸ்டாம்பு &amp; கையொப்பம் உள்ளது)/ பாஸ்பூக்/ அஞ்சல்
  அலுக்கு அறிக்கை/ அஞ்சல் அலுக்கு புகைப்படம்</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>3. குறை அட்டை</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>4. வாடகையாளர் அடையாளர் அடையாளர் சான்றிதழ்/ இ-வாடகையாளர் அடையாளர்</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;
  line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
  </span>5. வாக்கர் அனுமதி/ இ-வாக்கர் அனுமதி</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>6. பயண
  அனைத்து அடையாளர் கார்டு மூலம் வழங்கப்படும் பொது அரசு/ மாநில அரசு/ ஐபி அரசு</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>7. பென்ஷனர்
  கார்டு/ சுதாகார போராட்ட கார்டு</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>8. கிசான்
  பாஸ்பூக்</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>9. சி.ஜி.எச்/ இ.சி.எச்/
  ஈசிஸ்/ மெடிக்லேம் கார்டு மூலம் வழங்கப்படும் புகைப்படம் மாநில/ மாநில/ ஐபி அரசுகள்/ அதிகாரிகள் மூலம்
  வழங்கப்படும்</p>
  <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>10. சிகித்திப்
  ஐடி கார்டு/ இடைநிபாய மருத்துவ சான்றிதழ் அதிக மாநில/ ஐபி அரசுகள்/ நிர்வாகங்கள்/ மத்திய அரசு மூலம்
  வழங்கப்படும்</p>
  <p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;line-height:normal''><span
  style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>11. முகவரி வழங்கப்படும்
  மத்திய/மாநில அரசு மூலம் வழங்கப்படும் முகவரி ஐடி கார்டு/ சான்றிதழ்</p>
  </td>
  </tr>
</table>
 <p class=MsoNormal><span style=''font-size:16.0pt;line-height:107%;font-family:
  Arial,sans-serif;color:#1D1C1D;background:white''>&nbsp;</span></p>
  <p class=MsoNormal><span style=''font-size:16.0pt;line-height:107%;font-family:
  Arial,sans-serif;color:#1D1C1D;background:white''>&nbsp;</span></p>

     <table class=MsoTableGrid border=1 cellspacing=0 cellpadding=0
  style=''border-collapse:collapse;border:none''>
  <tr>
  <td width=623 colspan=2 valign=top style=''width:467.5pt;border:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
line-height:normal''><b><span style=''font-size:14.0pt;font-family:Arial,sans-serif;
color:#1D1C1D;background:aqua''>POR (உற்பத்தி சான்றிதழ்)</span></b></p>
<p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
  line-height:normal''><span style=''background:white''>&nbsp;</span></p>
  </td>
  </tr>
  <tr>
  <td width=274 valign=top style=''width:205.3pt;border:solid windowtext 1.0pt;
  border-top:none;padding:0in 5.4pt 0in 5.4pt''>
<p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
color:#1D1C1D;background:white''>POR ஆவண விவரங்கள்:</span></b></p>
 </td>
  <td width=350 valign=top style=''width:262.2pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>1. அறிவை உள்ளிட வணிகரின் முழு பெயர் மற்றும் ஒளி புகை உள்ளது</p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>2. விண்ணப்பரின் முழு பெயர் மற்றும் அருகில் வெளிச்சம் உள்ளது</p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>3. அறிவாளியும் வாசியின் இடையில் உள்ள உறவு தகவல் தெரிவு செய்ய வேண்டும்</p>
<p class=MsoListParagraphCxSpLast style=''margin-bottom:0in;text-indent:-.25in;
line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>4. அனைத்து உரிமங்களும் குறைந்தது 6 மாதங்கள் வாழ்க்கையில் செயல்படுத்த வேண்டும்</p>
  </td>
  </tr>
  <tr>
  <td width=274 valign=top style=''width:205.3pt;border:solid windowtext 1.0pt;
  border-top:none;padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
line-height:normal''><b><span style=''font-size:11.5pt;font-family:Arial,sans-serif;
color:#1D1C1D;background:white''>ஏற்கனவேரும் ஆவணம்:</span></b></p>
<p class=MsoNormal align=center style=''margin-bottom:0in;text-align:center;
line-height:normal''><span style=''font-size:16.0pt;font-family:Arial,sans-serif;
color:#1D1C1D;background:white''>&nbsp;</span></p>
</td>
  <td width=350 valign=top style=''width:262.2pt;border-top:none;border-left:
  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;
  padding:0in 5.4pt 0in 5.4pt''>
    <p class=MsoListParagraphCxSpFirst style=''margin-bottom:0in;text-indent:-.25in;
line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>1. உடனின் கடவுச்சொல்/ பெருமாளின் கடவுச்சொல் (பள்ளிக்கு விளக்கம் கொடுத்தால்) </p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>2. கடவுச்சொல்/ பிடிஎஸ் அட்டை</p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>3. மெடி-க்லேம் அட்டை மூலம் பெருமாளின் புகைப்படம் (மையம்/மாநிலம் அல்லது பொது சேவை நிறுவங்கள் மூலம் வெளியிடப்படும்)</p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>4. பெருமாள் அட்டை</p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>5. பிருதம பதிப்பு செய்யுதற் சான்றிதழ் (பிரிவாள் பதிக்கப்பட்டு மாநகர காரிகள் மற்றும் அறிக்கை செய்யுதற் அறிவாளுக்கள் வழங்கும்) </p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>6. மற்றொரு மத்திய/மாநில அரசு வீடுநிலை ஆதாரம் அனுமதிக்கப்பட்ட ஆதாரம்</p>
<p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
</span>7. அரசு வழக்காட்ட வழக்காட்டம்</p>
    <p class=MsoListParagraphCxSpMiddle style=''margin-bottom:0in;text-indent:
-.25in;line-height:normal''><span style=''font:7.0pt Times New Roman''>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
