	 ('2854','Success email to self update demographic data','Success email to self update demographic data','txt','velocity','عزيزي $name، <br>
  لقد نجح طلبك لتحديث البيانات مقابل معرف الحدث: #$eventId. <ر>
  سيتم إعلامك أيضًا عندما تكون البطاقة جاهزة للتنزيل. <ر>
  قم بتسجيل الدخول إلى الموقع الرسمي $trackServiceRequestLink لمزيد من التفاصيل. <ر>','10006','Resident Services','update-demo-data-regproc-success-email-content','ara',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
	 ('2855','Success email to self update demographic data','Success email to self update demographic data','txt','velocity',' ಆತ್ಮೀಯ $name, <br>
  ಈವೆಂಟ್ ಐಡಿಗೆ ವಿರುದ್ಧವಾಗಿ ಡೇಟಾವನ್ನು ನವೀಕರಿಸಲು ನಿಮ್ಮ ವಿನಂತಿಯು ಯಶಸ್ವಿಯಾಗಿದೆ: #$eventId. <br>
  ಕಾರ್ಡ್ ಡೌನ್‌ಲೋಡ್ ಮಾಡಲು ಸಿದ್ಧವಾದಾಗ ನಿಮಗೆ ಹೆಚ್ಚಿನ ಸೂಚನೆ ನೀಡಲಾಗುತ್ತದೆ. <br>
  ಹೆಚ್ಚಿನ ವಿವರಗಳಿಗಾಗಿ ಅಧಿಕೃತ ವೆಬ್‌ಸೈಟ್ $trackServiceRequestLink ಗೆ ಲಾಗ್ ಇನ್ ಮಾಡಿ. <br>','10006','Resident Services','update-demo-data-regproc-success-email-content','kan',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
	 ('2856','Success email to self update demographic data','Success email to self update demographic data','txt','velocity',' அன்புள்ள $name, <br>
  நிகழ்வு ஐடி: #$eventId க்கு எதிராக தரவைப் புதுப்பிப்பதற்கான உங்கள் கோரிக்கை வெற்றிகரமாக உள்ளது. <br>
  கார்டு பதிவிறக்கத் தயாரானதும் உங்களுக்கு மேலும் தெரிவிக்கப்படும். <br>
  மேலும் விவரங்களுக்கு அதிகாரப்பூர்வ இணையதளமான $trackServiceRequestLink இல் உள்நுழைக. <br>','10006','Resident Services','update-demo-data-regproc-success-email-content','tam',true,'superadmin','2024-09-13 07:15:15.394114',NULL,NULL,false,NULL),
	 ('2857','Success email to self update demographic data','Success email to self update demographic data','txt','velocity','Cher $name, <br>
  Votre demande de mise à jour des données a abouti par rapport à l''ID d''événement : #$eventId. <br>
