	 ('2858','Success email to self update demographic data','Success email to self update demographic data','txt','velocity',' प्रिय $name, <br>
  डेटा अपडेट करने का आपका अनुरोध इवेंट आईडी के विरुद्ध सफल है: #$eventId. <br>
